import React, { useState } from "react";
import AuthService from "../services/auth.service";
import { useNavigate } from "react-router-dom";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";

const RegisterPage = () => {
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [errors, setErrors] = useState({});
  const navigate = useNavigate();

  // const handleRegister = async (e) => {
  //   e.preventDefault();
  //   setErrors({});
  //   try {
  //     await AuthService.register(firstName, lastName, email, password);
  //     navigate("/login");
  //   } catch (error) {
  //     if (error.response && error.response.data && error.response.data.errors) {
  //       const errorMessages = error.response.data.errors;
  //       const newErrors = {};
  //       for (const key in errorMessages) {
  //         if (errorMessages.hasOwnProperty(key)) {
  //           newErrors[key] = errorMessages[key].join(" ");
  //         }
  //       }
  //       setErrors(newErrors);
  //     } else {
  //       setErrors({ general: "Registration failed." });
  //     }
  //   }

  // };
  const handleRegister = async (e) => {
    e.preventDefault();
    setErrors({});
    try {
      await AuthService.register(firstName, lastName, email, password);
      navigate("/login");
    } catch (error) {
      if (error.response?.data) {
        //if errors-objects from ValidationProblemDetails exists (from ModelState)
        // if (error.response.data.errors) {
        //   setErrors(error.response.data.errors);
        if (error.response.data.errors) {
          const errorMessages = error.response.data.errors;
          const newErrors = {};
          for (const key in errorMessages) {
            if (errorMessages.hasOwnProperty(key)) {
              newErrors[key] = errorMessages[key].join(" ");
            }
          }
          setErrors(newErrors);
        } else {
          // Other possible errors connected to Identity
          setErrors({
            general: Array.isArray(error.response.data)
              ? error.response.data.join(" ")
              : error.response.data.title || "Registration failed.",
          });
        }
      }
    }
  };

  return (
    <Form onSubmit={handleRegister}>
      <Form.Group className="mb-3" controlId="formFirstName">
        <Form.Label>First name</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter first name"
          value={firstName}
          onChange={(e) => setFirstName(e.target.value)}
        />
        {errors.FirstName && <p className="text-danger">{errors.FirstName}</p>}
      </Form.Group>
      <Form.Group className="mb-3" controlId="formLastName">
        <Form.Label>Last name</Form.Label>
        <Form.Control
          type="text"
          placeholder="Enter last name"
          value={lastName}
          onChange={(e) => setLastName(e.target.value)}
        />
        {errors.LastName && <p className="text-danger">{errors.LastName}</p>}
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicEmail">
        <Form.Label>Email</Form.Label>
        <Form.Control
          type="email"
          placeholder="Enter email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
        />
        {errors.Email && <p className="text-danger">{errors.Email}</p>}
      </Form.Group>
      <Form.Group className="mb-3" controlId="formBasicPassword">
        <Form.Label>Password</Form.Label>
        <Form.Control
          type="password"
          placeholder="Enter password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
        {errors.Password && <p className="text-danger">{errors.Password}</p>}
      </Form.Group>
      <Button variant="primary" type="submit">
        Register
      </Button>
     
      {errors[""] && (
        <p className="text-danger">
          {Array.isArray(errors[""]) ? errors[""].join("") : errors[""]}
        </p>
      )}
      {errors.general && <p className="text-danger">{errors.general}</p>}
    </Form>
  );
};

export default RegisterPage;
